import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';

import HomePage from './pages/homepage/homepage.component';

const HatPage = ()=> (
  <div>
    <h1>HAT PAGE</h1>
  </div>
)

function App() {
  return (
  <div>
   <Switch> 

<Route path='/' component={HomePage} />
<Route path='/hat' component={HatPage} />

</Switch>
  </div>
  )
}

export default App;
